    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Wallkill River NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Wallkill River NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, a summary of Refuge
    resources, information about the management direction, and strategies for implementation.
    Key planning issues include: wildlife management, public use, control of invasive
    species, hunting, Refuge administration, land protection, and cultural resources.",nt"owner_org":
